pub enum Validation {
    Success {
        is_new_best: bool,
    },
    Failure {
        disconnect: bool,
    },
}

pub enum BlockImportResult<N: std::fmt::Debug + PartialEq> {
    ImportedKnown(N, Option<Origin>),
    ImportedUnknown(N, ImportedAux, Option<Origin>),
}

pub enum Error {
    BadProposalFormat(codec::Error),
    WrongParentHash {
        expected: String,
        got: String,
    },
    WrongNumber {
        expected: BlockNumber,
        got: BlockNumber,
    },
}
